def is_prime(n):
    """Check if a number is a prime number"""
    if n <= 1:
        return False
    elif n <= 3:
        return True
    elif n % 2 == 1 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

